import "./ExpenseItem.css";

function ExpenseItem(bright) {
  return (
    <div className='expense-item'>
      <div>{bright.date.toISOString()}</div>
      <div className='expense-item__description'>
        <h2>{bright.title}</h2>
        <div className='expense-item__price'>$ {bright.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
